import { Fragment } from 'react';
import React from 'react';
import './Header.css';
// import portfolio_logo from '../../Assets/portfolio_logo.png';

const Header=()=>{
    
    return(
            <Fragment>
                <div className="Header">
                    <div className='logo'>
                        <h1>PRIANS__</h1>
                    </div>
                </div>
                <div className='Options'>
                    <a href='#'>Home</a>
                    <a href='#'>Resources</a>
                    <a href='#'>Skills</a>
                    <a href='#'>about Me</a>
                </div>
            </Fragment>
    );
};

export default Header;
